import React from 'react'

const Calculator = () => {
const numbers = ['C', '1', '2', '+', '3', '4', '-', '5', '6', '*', '7', '8', '/', '=', '9', '0', '.']
  return (
    <>
   <div className="calstyle">
    <input className="inputstyle" type='text' readOnly/><br/>
    {
        numbers.map((allNumbers)=>{
            return(    
     <button className="buttonstyle">{allNumbers}</button>
    )
        })
    }
   
   </div>
    </>
  )
}

export default Calculator
